import React from 'react';
import {NavLink} from 'react-router-dom';
import './menu.css';

function Menu(){
    return(
        <>
        <NavLink to="/">Home</NavLink>
        <NavLink to="/About">About Us</NavLink>
        <NavLink to="/Items">Items</NavLink>
        <NavLink to="Booking">Booking</NavLink>
        </>
    )
}

export default Menu;
